const style = document.createElement('style');
const base64Image = 'data:image/webp;base64,';

style.textContent = `
	/* Your CSS rules here */
	/* Body Background */
	body {
		background: linear-gradient(rgba(31, 31, 31, 0.1), rgba(31, 31, 31, 0.1)), url('${base64Image}'); /* Replace with your base64 image or leave empty */
		background-size: cover;
		background-repeat: no-repeat;
		background-attachment: fixed;
	}

	/* Titlebar */
	div[data-tid^="app-layout-area--title-bar"] {
		background-color: transparent !important;
	}
	div[data-tid^="app-layout-area--title-bar"] span {
		color: black !important;
	}

	/* Searchbox */
	div[id^='ms-searchux-search-box-'] {
		background-color: transparent !important;
	}
	div[id^='ms-searchux-search-box-'] input {
		color: black !important;
	}

	/* Header Buttons */
	[data-tid=default-rail-header] button {
		color: black;
	}

	/* Message Pane */
	#message-pane-layout-a11y {
		background-color: transparent;
	}

	/* Divider Wrapper */
	.fui-Divider__wrapper {
		color: black !important;
	}

	/* Timestamp Labels */
	time[id^="timestamp-"] {
		color: black !important;
	}

	/* Importance Labels */
	div[id^="importance-"],
	div[id^="important-badge-"] {
		color: red !important;
	}

	/* Read Status Icons */
	span[id^="read-status-icon-"] {
		color: black !important;
	}

	/* Chat List Categories */
	[role="treeitem"] span[class^="ui-tree__title"] {
		color: black !important;
	}

	/* chat list */
	[data-tid="chat-list-layout"] {
		background-color: transparent !important;
		color: black !important;
	}

	/* Chat List Single Chat Entry */
	div[id^="chat-list-item"] span {
		color: black !important !important;
	}
	div[id^="chat-list-item"] {
		margin-top: 20px !important;
		margin-bottom: 20px !important;
		background-color: rgba(31, 31, 31, 0.3) !important;
		border-radius: 8px;
	}
	div[id^="chat-list-item"]:hover {
		background-color: lightblue !important;
	}

	/* Chat Author Name */
	div[class^="fui-unstable-ChatItem"] span {
		color: white !important;
		font-weight: bold !important;
	}

	/* App Layout Area */
	.fui-AppLayoutArea,
	.fui-AppLayoutArea > * {
		background-color: transparent !important;
	}

	/* Chat Header */
	div[id^="chat-header"] {
		background-color: transparent;
	}
	div[id^="chat-header"] span {
		color: black !important;
	}

		`;
document.head.appendChild(style);

